        "# PART 2\n",
        "# PART - 2\n",
        "import matplotlib.pyplot as plt\n",
        "\n",
        "# Given dataset\n",
        "people = ['kiran', 'arun', 'vijay', 'varun']\n",
        "age = [25, 30, 35, 40, 45]\n",
        "height = [145, 151, 165, 173,0]\n",
        "weight = [45, 55, 65, 75,0]\n",
        "\n",
        "# 1. Scatter Plot\n",
        "plt.figure(figsize=(8, 6))\n",
        "plt.scatter(age, height, color='blue', label='height')\n",
        "plt.scatter(age, weight, color='red', label='Weight')\n",
        "plt.title('Scatter Plot of Age vs. Height and Weight')\n",
        "plt.xlabel('Age')\n",
        "plt.ylabel('Height and Weight')\n",
        "plt.legend()\n",
        "plt.grid(True)\n",
        "plt.show()\n",
        "# 2. Line Plot\n",
        "plt.figure(figsize=(8, 6))\n",
        "plt.plot(age, height, marker='o', linestyle='-', color='blue', label='Height')\n",
        "plt.plot(age, weight, marker='o', linestyle='-', color='red', label='Weight')\n",
        "plt.title('Line Plot of Height and Weight for Each Person')\n",
        "plt.xlabel('People')\n",
        "plt.ylabel('Height and Weight')\n",
        "plt.legend()\n",
        "plt.grid(True)\n",
        "plt.show()\n",
        "# 3. Bar Chart\n",
        "plt.figure(figsize=(8, 6))\n",
        "bar_width = 0.35\n",
        "index = range(len(people))\n",
        "plt.bar(age, height, width=bar_width, color='blue', label='Height')\n",
        "plt.bar([i + bar_width for i in age], weight, width=bar_width, color='red', label='Weight')\n",
        "plt.xlabel('People')\n",
        "plt.ylabel('Height and Weight')\n",
        "plt.title('Bar Chart of Height and Weight for Each Person')\n",
        "plt.xticks([i + bar_width/2 for i in index], people)\n",
        "plt.legend()\n",
        "plt.show()\n",
        "\n",
        "#  ScatterPlot\n",
        "plt.figure(figsize=(8, 6))\n",
        "plt.scatter(age, height, color='blue', label='height')\n",
        "plt.scatter(age, weight, color='red', label='Weight')\n",
        "plt.title('Scatter Plot of Age vs. Height and Weight')\n",
        "plt.xlabel('Age')\n",
        "plt.ylabel('Height and Weight')\n",
        "plt.legend()\n",
        "plt.grid(True)\n",
        "plt.show()\n",
        "\n",
        "# 4. Bar Chart\n",
        "plt.figure(figsize=(8, 6))\n",
        "bar_width = 0.35\n",
        "index = range(len(people))\n",
        "plt.bar(age, height, width=bar_width, color='blue', label='Height')\n",
        "plt.bar([i + bar_width for i in age], weight, width=bar_width, color='red', label='Weight')\n",
        "plt.xlabel('People')\n",
        "plt.ylabel('Height and Weight')\n",
        "plt.title('Bar Chart of Height and Weight for Each Person')\n",
        "plt.xticks([i + bar_width/2 for i in index], people)\n",
        "plt.legend()\n",
        "plt.show()\n",
        "\n",
        "# 5. Histogram\n",
        "plt.figure(figsize=(8, 6))\n",
